import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import firebase from "firebase";

var config = {
  databaseURL: "https://sneh-33f7d-default-rtdb.firebaseio.com",
  projectId: "sneh-33f7d",
};
firebase.initializeApp(config);

class App extends React.Component {
  constructor(props){
    super(props);
    this.state={name: '', age: '', email: '', symptoms: ''};
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange(event) {
    this.setState({value: event.target.value});
  }
  render() {
    return (
      <div className ="wrap">
          <h1 className="string">What's your name?</h1>
          <input value={this.state.name} type="text" id="name" onChange={(e)=>{this.setState({name: e.target.value})}}/>
          <h1 className="string">How old are you?</h1>
          <input  value={this.state.age} onChange={(e)=>{this.setState({age: e.target.value})}} type="text" id="age" />
          <h1 className="string">What is your email?</h1>
          <input  value={this.state.email} onChange={(e)=>{this.setState({email: e.target.value})}} type="text" id="email" />
          <h1 className="string">What are your symptoms?</h1>
          <input  value={this.state.symptoms} onChange={(e)=>{this.setState({symptoms: e.target.value})}} type="text" id="symptoms" />
          <h1 className="string">Hi {this.state.name}! Your data has been recorded and our representative will shortly message you!</h1>
          write({this.state.name}, {this.state.age}, {this.state.email}, {this.state.symptoms})
       </div>
    )
  }
}


function write(email,fname,lname){
  firebase.database().ref('UsersList/').push({
      email,
      fname,
      lname
  }).then((data)=>{
      //success callback
      console.log('data ' , data)
  }).catch((error)=>{
      //error callback
      console.log('error ' , error)
  })
}
